import './App.css'

const Home = () => {

    const handleAddDevice = () => {
        console.log('Add device button was pressed');
    }

    return ( 
        <div className="home-container">
        <div className="home-home-test-devices">
        <div className="home-test-devices-header">
        <h1 className="home-test-devices-text">Home - Test Devices</h1>
        <button onClick={handleAddDevice} type="button" className="home-add-device-button button">
            <span>Add device</span>
        </button>
        </div>
        <div className="home-test-devices-container">
            {Array(4).fill().map((_, index) => (
                <div className="home-device1" key={index}>
                <h2 className="home-device1title">
                    <span>Device #</span>
                </h2>
                <span className="home-device1status">Status: {index === 3 ? 'Not Started' : 'In Progress'}</span>
                <button type="button" className="home-device1button button">
                    View tests
                </button>
                </div>
            ))}
        </div>
        </div>
        </div>
    );
}

export default Home;
